import React from 'react';
import './Styles/Header.css';

const Header = () => {
    return (
        <>
        <nav className="header"> 
        <h1>Fonzo's Vet Services</h1>
        <ul className="nav-links">
            <li className="nav-item">first liink</li>
        </ul>
        </nav>
        <div className="header"><h1>Fonzo's Vet Services</h1></div>
        </>
    );
};

export default Header;
